import numpy as np
import cv2

def crop_bbox_left(left_info, padding):

    # tlc: left top corner, brc: right bottom corner
    tlc = left_info[1]
    brc = left_info[2]
    
    brc = [left_info[0][2], left_info[0][3]]

    tlc[0], tlc[1] = max(0, tlc[0]-padding), max(0, tlc[1]-padding)
    brc[0], brc[1] = min(2800, brc[0]+padding), min(2800, brc[1]+padding) 

    return tlc, brc

def crop_bbox_right(right_info, padding):

    # tlc: left top corner, brc: right bottom corner
    tlc = right_info[1]
    brc = right_info[2]

    tlc[0], tlc[1] = max(0, right_info[0][0]-padding), max(0, tlc[1]-padding)
    brc[0], brc[1] = min(2800, brc[0]+padding), min(2800, right_info[0][3]+padding) 

    return tlc, brc

def crop(QiGuan_Return, padding):
    left_info = QiGuan_Return['RuTouYing_return_left']
    right_info = QiGuan_Return['RuTouYing_return_right']
    if 'None' in right_info or 'None' in left_info:
        return None
    left_tlc, left_brc = crop_bbox_left(left_info, padding)
    right_tlc, right_brc = crop_bbox_right(right_info, padding)

    return left_tlc, left_brc, right_tlc, right_brc

